const Header = () => {

    return (
        <section id="hero">
            <div class="hero container">
                <div>
                    <h1>New Energy <span></span></h1>
                    <h1>Nano material <span></span></h1>
                    <h1>Optimization Lab <span></span></h1>
                    <a href="#about" type="button" class="cta">NTU539</a>
                </div>
            </div>
        </section>
    )

}
export default Header;
